from sympy import mobius, integer_nthroot
def A378358(n):
    def f(x): return int(1-sum(mobius(k)*(integer_nthroot(x,k)[0]-1) for k in range(2,x.bit_length())))
    a = max(1,n-f(n-1))
    m, k = a, f(a)+a
    while m != k: m, k = k, f(k)+a
